window.bookSummaryJSON = "<p><b>The dragon king took me as his captive. He kept me as his mate.</b></p> <p>For years I've lived on the streets, stealing to survive, not knowing that one day the most powerful dragon in all the realms would come for me and carry me off to his world.</p> <p>I tried to run. Then I tried to fight. But as the dark king tore my clothes off and spanked me into shameful surrender right there in his throne room, he made it known I'm not just his prisoner.</p> <p>I'm his mate.</p> <p>But as he tames my virgin body with one brutal climax after another, the truth becomes clear.</p> <p>He may have brought me here to fulfil a prophecy, but he's keeping me because I belong to him.</p> <p>Forever.</p> <p><b>Publisher's Note:</b> <i>Dark King</i> is a stand-alone novel which is the fourth book of the <i>Dragonborne Kings</i> series. It includes spankings and rough, intense sexual scenes. If such material offends you, please don't buy this book.</p>"; 
